import React, { useState, Component } from 'react';
import api from '../services/api';

class UploadTest extends Component {

    render() {
        return (
            <div>
                <h1>HTML</h1>
                <form >
                <h1>File Upload</h1>
                <input type="file" name="myImage"  />
                <button type="submit">Upload</button>
            </form>
            </div>
            
        )
    }
}

export default UploadTest;
